INSERT INTO `pesquisa_satisfacao` VALUES (1,'1124-000504','IPSEC - Produto 164 Sp2 Sitef Hospedado - Outros','2024-11-27','2024-11-27','Maravilhas do Lar','Matheus Belo','Gustavo Maciel','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','Em uma escala de 0 a 10, quanto você recomendaria nossa empresa para amigos ou familiares?','0',''),(2,'1124-000504','IPSEC - Produto 164 Sp2 Sitef Hospedado - Outros','2024-11-27','2024-11-27','Maravilhas do Lar','Matheus Belo','Gustavo Maciel','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','Como você avalia a qualidade do atendimento prestado neste chamado?','Péssimo',''),(3,'1124-000504','IPSEC - Produto 164 Sp2 Sitef Hospedado - Outros','2024-11-27','2024-11-27','Maravilhas do Lar','Matheus Belo','Gustavo Maciel','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','A nossa empresa facilitou a solução do seu Problema ou Requisição?','Discordo Totalmente',''),(4,'1124-000504','IPSEC - Produto 164 Sp2 Sitef Hospedado - Outros','2024-11-27','2024-11-27','Maravilhas do Lar','Matheus Belo','Gustavo Maciel','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','Deixa uma Mensagem para a nossa Gestão :)','','Estamos extremamente insatisfeitos com o suporte recebido. Tentamos, por diversas vezes, explicar nosso problema ao Gabriel, mas as respostas foram superficiais, sem demonstrar interesse real em ajudar a resolver a questão. Em vez disso, recebemos respostas padrões, alegando que o ping para o servidor da Sitef não é parâmetro para avaliar o funcionamento do serviço. No entanto, sempre que observamos perda de pacotes para o servidor da Sitef, enfrentamos graves transtornos nas lojas, com cartões não sendo processados, o que causa prejuízos significativos.\r\n\r\nGostaríamos de destacar que escalamos o caso para o Fábio, que entendemos ser o gestor da equipe de suporte. Contudo, isso também não trouxe nenhum resultado ou melhoria no atendimento prestado.\r\nDiante dessa situação, vamos escalar ainda mais o problema. Não podemos esperar que o problema aconteça, abrir um chamado e aguardar a análise enquanto nossas lojas perdem vendas em um dos períodos mais críticos do ano, o final de ano. Precisamos de uma solução imediata e eficaz.'),(5,'1124-000598','TLS - Produto 87 Windows - Dúvidas','2024-12-04','2024-11-29','SKYTEF | FISERV','Gabriel Santos','Danilo Neto','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','Em uma escala de 0 a 10, quanto você recomendaria nossa empresa para amigos ou familiares?','10',''),(6,'1124-000598','TLS - Produto 87 Windows - Dúvidas','2024-12-04','2024-11-29','SKYTEF | FISERV','Gabriel Santos','Danilo Neto','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','Como você avalia a qualidade do atendimento prestado neste chamado?','Ótimo',''),(7,'1124-000598','TLS - Produto 87 Windows - Dúvidas','2024-12-04','2024-11-29','SKYTEF | FISERV','Gabriel Santos','Danilo Neto','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','A nossa empresa facilitou a solução do seu Problema ou Requisição?','Concordo Totalmente',''),(8,'1124-000598','TLS - Produto 87 Windows - Dúvidas','2024-12-04','2024-11-29','SKYTEF | FISERV','Gabriel Santos','Danilo Neto','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','Deixa uma Mensagem para a nossa Gestão :)','',''),(9,'1224-000382','Portal - Comnect - Outros','2024-12-20','2024-12-20','TOTVS SA','Thiago Martimiano','Paulo Souza','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','Em uma escala de 0 a 10, quanto você recomendaria nossa empresa para amigos ou familiares?','10',''),(10,'1224-000382','Portal - Comnect - Outros','2024-12-20','2024-12-20','TOTVS SA','Thiago Martimiano','Paulo Souza','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','Como você avalia a qualidade do atendimento prestado neste chamado?','Ótimo',''),(11,'1224-000382','Portal - Comnect - Outros','2024-12-20','2024-12-20','TOTVS SA','Thiago Martimiano','Paulo Souza','SUPORTE COMNEcT - N1','Atendimento - NPS, CES e CSAT','A nossa empr